import React from 'react';
import headerImg from '../../media/images/headerImg.jpeg'
import GetGameData from '../../reducers/GameDataAPI';
const Header = () => {
    const instance = GetGameData;
    console.log(instance);
    return (
        <div className="header">
            <img src={headerImg} alt="Houston Rockets" />
            <div className="game-detail">
                <h3>Houston Rockets Box Score</h3>
                <h4>{instance.date}</h4>
                <h4>{instance.time}</h4>
                <h4>{instance.opponent}</h4>
                <h4>{instance.city}, {instance.state}</h4>
                <h4>{instance.status}</h4>
            </div>
        </div>
    )
}

export default Header;
